// 사용자 정의 오버레이 생성 함수
function createCustomOverlay(position, text) {
  var content = document.createElement('div');
  content.className = 'customOverlay';
  content.innerHTML = text;
  
  var overlay = new kakao.maps.CustomOverlay({
    position: position,
    content: content,
    map: null
  });
  
  overlays.push(overlay);
  return overlay;
}

    ];
    
    // 클러스터러 초기화 (초기에는 비활성화)
    var yangjaeClusterer = new kakao.maps.MarkerClusterer({
      map: map,
      averageCenter: true,

    var gangnamClusterer = new kakao.maps.MarkerClusterer({
      map: map,
      averageCenter: true,
      minLevel: 1,            // 모든 레벨에서 클러스터링 활성화

      if (level <= DONG_LEVEL) {

        if (isYangjaeClusteringEnabled) yangjaeClusterer.setMinLevel(0);

        if (isYangjaeClusteringEnabled) yangjaeClusterer.setMinLevel(1);

      }
    });
    
    // 클러스터 클릭 이벤트 (줌 인)

      map.setLevel(level, { anchor: cluster.getCenter() });
    });
    
    kakao.maps.event.addListener(gangnamClusterer, 'clusterclick', function(cluster) {
      var level = map.getLevel() - 1;
      map.setLevel(level, { anchor: cluster.getCenter() });
    });
    
    // 근무지 마커 추가
    var yangjaeOffice = new kakao.maps.Marker({position: new kakao.maps.LatLng(37.4841, 127.0356), map: map, title: '양재 근무지', image: new kakao.maps.MarkerImage('https://t1.daumcdn.net/localimg/localimages/07/mapapidoc/markerStar.png', new kakao.maps.Size(24, 35))}); officeMarkers.push(yangjaeOffice); officeYangjae.push(yangjaeOffice);
  var gangnamOffice = new kakao.maps.Marker({position: new kakao.maps.LatLng(37.4980, 127.0273), map: map, title: '강남 근무지', image: new kakao.maps.MarkerImage('https://t1.daumcdn.net/localimg/localimages/07/mapapidoc/markerStar.png', new kakao.maps.Size(24, 35))}); officeMarkers.push(gangnamOffice); officeGangnam.push(gangnamOffice);
    
    // 직원 마커 미리 생성 (최적화)
    var yangjaeMarkersArray = []; // 양재 직원 마커 배열
    var gangnamMarkersArray = []; // 강남 직원 마커 배열
    
    // 양재 직원 마커 생성
    yangjaeMarkers.forEach(function(markerData) {
      var position = new kakao.maps.LatLng(markerData.lat, markerData.lng);
      
  // 마커 생성 (이미지 마커로 변경)
     var marker = new kakao.maps.Marker({
     position: position,
     title: '양재 직원 거주지',
     image: new kakao.maps.MarkerImage('./green_gps.png', new kakao.maps.Size(24, 24))
     });
  
      // 오버레이 생성
      var overlay = createCustomOverlay(position, '<div style="padding:5px;font-size:12px;">' + markerData.info + '</div>');
      
      // 마커 클릭 이벤트
      kakao.maps.event.addListener(marker, 'click', function() {
        // 모든 오버레이 닫기
        overlays.forEach(function(o) { o.setMap(null); });
        // 현재 오버레이 열기
        overlay.setMap(map);
      });
      
      // 마커 배열에 추가
      yangjaeStaffMarkers.push(marker);
      yangjaeMarkersArray.push(marker);
    });
    
    // 강남 직원 마커 생성
    gangnamMarkers.forEach(function(markerData) {
    var position = new kakao.maps.LatLng(markerData.lat, markerData.lng);
  
  // 마커 생성 (이미지 마커로 변경)
    var marker = new kakao.maps.Marker({
    position: position,
    title: '강남 직원 거주지',
    image: new kakao.maps.MarkerImage('./red_gps.png', new kakao.maps.Size(24, 24))
    });
      
      // 오버레이 생성
      var overlay = createCustomOverlay(position, '<div style="padding:5px;font-size:12px;">' + markerData.info + '</div>');
      
      // 마커 클릭 이벤트
      kakao.maps.event.addListener(marker, 'click', function() {
        // 모든 오버레이 닫기
        overlays.forEach(function(o) { o.setMap(null); });
        // 현재 오버레이 열기
        overlay.setMap(map);
      });
      
      // 마커 배열에 추가
      gangnamStaffMarkers.push(marker);
      gangnamMarkersArray.push(marker);
    });
    
    // 최초 마커 클러스터링 적용
    if (yangjaeMarkersArray.length > 0) {
      yangjaeClusterer.addMarkers(yangjaeMarkersArray);
    }
    
    if (gangnamMarkersArray.length > 0) {
      gangnamClusterer.addMarkers(gangnamMarkersArray);
    }
    
    // 맵 클릭 시 오버레이 닫기
    kakao.maps.event.addListener(map, 'click', function() {
      overlays.forEach(function(overlay) {
        overlay.setMap(null);
      });
    });
    
    // GeoJSON 렌더링
    function renderGeoJSON() {
      if (!geojsonData || !geojsonData.features) {
        console.error('GeoJSON 데이터가 유효하지 않습니다.');
        return;
      }
      
      geojsonData.features.forEach(function(feature, index) {
        if (!feature || !feature.properties || !feature.geometry || !feature.geometry.coordinates) {
          console.warn('유효하지 않은 feature at index', index);
          return;
        }
        
        var color = feature.properties.sido === '11' ? '#FF0000' : // 서울
                    feature.properties.sido === '28' ? '#00FF00' : // 인천
                    '#0000FF'; // 경기
        
        try {
          if (feature.geometry.type === 'Polygon') {
            var coordinates = feature.geometry.coordinates[0];
            if (!coordinates || !Array.isArray(coordinates) || coordinates.length === 0) {
              console.warn('유효하지 않은 Polygon coordinates at index', index);
              return;
            }
            
            var path = coordinates.map(function(coord) {
              if (!coord || !Array.isArray(coord) || coord.length < 2) {
                return null;
              }
              return new kakao.maps.LatLng(coord[1], coord[0]);
            }).filter(coord => coord !== null);
            
            if (path.length === 0) {
              console.warn('유효한 좌표가 없음 at index', index);
              return;
            }
            
            var polygon = new kakao.maps.Polygon({
              path: path,
              strokeWeight: 2,
              strokeColor: color,
              strokeOpacity: 0.8,
              fillColor: color,
              fillOpacity: 0.1
            });
            
            polygon.setMap(map);
            boundaryPolygons.push(polygon);
          } 
          else if (feature.geometry.type === 'MultiPolygon') {
            feature.geometry.coordinates.forEach(function(polygonCoords) {
              if (!polygonCoords || !Array.isArray(polygonCoords) || !polygonCoords[0]) {
                return;
              }
              
              var path = polygonCoords[0].map(function(coord) {
                if (!coord || !Array.isArray(coord) || coord.length < 2) {
                  return null;
                }
                return new kakao.maps.LatLng(coord[1], coord[0]);
              }).filter(coord => coord !== null);
              
              if (path.length === 0) {
                return;
              }
              
              var polygon = new kakao.maps.Polygon({
                path: path,
                strokeWeight: 2,
                strokeColor: color,
                strokeOpacity: 0.8,
                fillColor: color,
                fillOpacity: 0.1
              });
              
              polygon.setMap(map);
              boundaryPolygons.push(polygon);
            });
          }
        } catch (e) {
          console.error('GeoJSON 처리 중 에러:', e.message);
        }
      });
    }
    
    // 지하철역 마커 추가
    function addStationMarkers() {
      Object.keys(subway_stations).forEach(function(station) {
        var marker = new kakao.maps.Marker({
          position: new kakao.maps.LatLng(
            subway_stations[station].lat,
            subway_stations[station].lng
          ),
          map: null, // 초기에는 지도에 표시하지 않음
          title: station
        });
        
        // 지하철역 이름표 오버레이 생성
        var overlay = createCustomOverlay(marker.getPosition(), '<div style="padding:5px;font-size:12px;">' + station + ' 역</div>');
        
        // 마커에 클릭 이벤트 추가
        kakao.maps.event.addListener(marker, 'click', function() {
          // 모든 오버레이 닫기
          overlays.forEach(function(o) { o.setMap(null); });
          // 현재 오버레이 열기
          overlay.setMap(map);
        });
        
        stationMarkers.push(marker);
      });
    }
    
    // GeoJSON 렌더링
    renderGeoJSON();
    
    // 지하철역 마커 추가
    addStationMarkers();
    
    // 컨트롤 설정 함수 - 성능 최적화된 버전
    function setupControls() {
      document.getElementById('show_office_yangjae').addEventListener('change', function(e) {
        officeYangjae.forEach(function(marker) {
          marker.setMap(e.target.checked ? map : null);
        });
      });
      
      document.getElementById('show_office_gangnam').addEventListener('change', function(e) {
        officeGangnam.forEach(function(marker) {
          marker.setMap(e.target.checked ? map : null);
        });
      });
      
      // 양재 직원 마커 표시/숨김 (성능 최적화)
      document.getElementById('show_staff_yangjae').addEventListener('change', function(e) {
        if (e.target.checked) {
          // 클러스터러에 마커 일괄 추가
          yangjaeClusterer.addMarkers(yangjaeMarkersArray);
          isYangjaeClusteringEnabled = true;
          
          // 현재 줌 레벨에 따라 클러스터링 여부 결정
          var level = map.getLevel();
          if (level <= DONG_LEVEL) {
            yangjaeClusterer.setMinLevel(0);
          } else {
            yangjaeClusterer.setMinLevel(1);
          }
        } else {
          // 클러스터러에서 마커 일괄 제거
          yangjaeClusterer.clear();
          isYangjaeClusteringEnabled = false;
        }
      });
      
      // 강남 직원 마커 표시/숨김 (성능 최적화)
      document.getElementById('show_staff_gangnam').addEventListener('change', function(e) {
        if (e.target.checked) {
          // 클러스터러에 마커 일괄 추가
          gangnamClusterer.addMarkers(gangnamMarkersArray);
          isGangnamClusteringEnabled = true;
          
          // 현재 줌 레벨에 따라 클러스터링 여부 결정
          var level = map.getLevel();
          if (level <= DONG_LEVEL) {
            gangnamClusterer.setMinLevel(0);
          } else {
            gangnamClusterer.setMinLevel(1);
          }
        } else {
          // 클러스터러에서 마커 일괄 제거
          gangnamClusterer.clear();
          isGangnamClusteringEnabled = false;
        }
      });
      
      document.getElementById('show_boundaries').addEventListener('change', function(e) {
        boundaryPolygons.forEach(function(polygon) {
          polygon.setMap(e.target.checked ? map : null);
        });
      });
      
      document.getElementById('show_stations').addEventListener('change', function(e) {
        stationMarkers.forEach(function(marker) {
          marker.setMap(e.target.checked ? map : null);
        });
      });
      
      document.getElementById('btn_show_all').addEventListener('click', function() {
        // 체크박스 상태 변경
        ['show_office_yangjae', 'show_office_gangnam', 'show_staff_yangjae',
         'show_staff_gangnam', 'show_boundaries', 'show_stations'].forEach(function(id) {
          var checkbox = document.getElementById(id);
          if (!checkbox.checked) {
            checkbox.checked = true;
            // 이벤트 직접 발생
            var event = new Event('change');
            checkbox.dispatchEvent(event);
          }
        });
      });
      
      document.getElementById('btn_save_html').addEventListener('click', function() {
        var blob = new Blob([document.documentElement.outerHTML], {type: 'text/html'});
        var url = URL.createObjectURL(blob);
        var a = document.createElement('a');
        a.href = url;
        a.download = 'kakao_map_custom.html';
        a.click();
        URL.revokeObjectURL(url);
      });
    }
    
    // 컨트롤 설정
    setupControls();
    
    // 로딩 인디케이터 제거
    document.getElementById('loading').style.display = 'none';
    
    console.log('초기화 및 렌더링 완료');
    
  } catch (e) {
    console.error('지도 초기화 중 오류:', e);
    document.getElementById('loading').innerHTML = '지도 초기화 중 오류가 발생했습니다.<br>' + e.message;
  }
}

// 페이지 로드 시 지도 초기화
window.onload = initMap;
</script>
